import React from 'react';
import Link from 'next/link';

class App extends React.Component {

    render() {
        return (
            <React.Fragment>

                <h1>Hello World!</h1>

                <li>
                    <Link href="/pageOne" >
                        <a title="page One"> Page One</a>
                    </Link>
                </li>

                <li>
                    <Link href="/pageTwo" >
                        <a title="page Two">Page Two</a>
                    </Link>
                </li>

                <li>
                    <Link href="/pageThree" >
                        <a title="page Three">Page Three</a>
                    </Link>
                </li>

            </React.Fragment>

        )
    }

}

export default App;
